query:
MATCH (c:Category {categoryName: "Beverages"})<-[:PART_OF]-(p:Product)<-[:SUPPLIES]-(s:Supplier)
RETURN DISTINCT s.companyName
ORDER BY s.companyName;

MATCH (c:Category)<-[:PART_OF]-(p:Product)
RETURN c.categoryName AS category, COUNT(p) AS product_count
ORDER BY product_count DESC, category;
